package variaveis;

public class TesteConversaoVariaveis1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 5;
		float b = 10.5f;
		
		int c =(int)b;
		b = a;
		
		System.out.println("Variavel a="+a);
		System.out.println("Variavel b="+b);
		System.out.println("Variavel c="+c);

	}

}
